import { useEffect } from "react";
import $ from "jquery";
import logo from "./logo.svg";
import "./App.css";

function App() {
  useEffect(() => {
    var timelines = $(".cd-horizontal-timeline"),
      eventsMinDistance = 60;

    if (timelines.length > 0) initTimeline(timelines);

    function initTimeline(timelines) {
      timelines.each(function () {
        var timeline = $(this),
          timelineComponents = {};

        timelineComponents["timelineWrapper"] =
          timeline.find(".events-wrapper");
        timelineComponents["eventsWrapper"] =
          timelineComponents["timelineWrapper"].children(".events");
        timelineComponents["fillingLine"] =
          timelineComponents["eventsWrapper"].children(".filling-line");
        timelineComponents["timelineEvents"] =
          timelineComponents["eventsWrapper"].find("a");
        timelineComponents["timelineDates"] = parseDate(
          timelineComponents["timelineEvents"]
        );
        timelineComponents["eventsMinLapse"] = minLapse(
          timelineComponents["timelineDates"]
        );
        timelineComponents["timelineNavigation"] =
          timeline.find(".cd-timeline-navigation");
        timelineComponents["eventsContent"] =
          timeline.children(".events-content");

        setDatePosition(timelineComponents, eventsMinDistance);
        var timelineTotWidth = setTimelineWidth(
          timelineComponents,
          eventsMinDistance
        );

        timeline.addClass("loaded");

        timelineComponents["timelineNavigation"].on(
          "click",
          ".next",
          function (event) {
            event.preventDefault();
            updateSlide(timelineComponents, timelineTotWidth, "next");
          }
        );
        timelineComponents["timelineNavigation"].on(
          "click",
          ".prev",
          function (event) {
            event.preventDefault();
            updateSlide(timelineComponents, timelineTotWidth, "prev");
          }
        );

        timelineComponents["eventsWrapper"].on("click", "a", function (event) {
          event.preventDefault();
          timelineComponents["timelineEvents"].removeClass("selected");
          $(this).addClass("selected");
          updateOlderEvents($(this));
          updateFilling(
            $(this),
            timelineComponents["fillingLine"],
            timelineTotWidth
          );
          updateVisibleContent($(this), timelineComponents["eventsContent"]);
        });

        timelineComponents["eventsContent"].on("swipeleft", function () {
          var mq = checkMQ();
          if (mq === "mobile")
            showNewContent(timelineComponents, timelineTotWidth, "next");
        });
        timelineComponents["eventsContent"].on("swiperight", function () {
          var mq = checkMQ();
          if (mq === "mobile")
            showNewContent(timelineComponents, timelineTotWidth, "prev");
        });

        $(document).keyup(function (event) {
          if (event.which === 37 && elementInViewport(timeline.get(0))) {
            showNewContent(timelineComponents, timelineTotWidth, "prev");
          } else if (event.which === 39 && elementInViewport(timeline.get(0))) {
            showNewContent(timelineComponents, timelineTotWidth, "next");
          }
        });
      });
    }

    function updateSlide(timelineComponents, timelineTotWidth, string) {
      var translateValue = getTranslateValue(
          timelineComponents["eventsWrapper"]
        ),
        wrapperWidth = Number(
          timelineComponents["timelineWrapper"]
            .css("width")
            .replace("px", "")
        );

      string === "next"
        ? translateTimeline(
            timelineComponents,
            translateValue - wrapperWidth + eventsMinDistance,
            wrapperWidth - timelineTotWidth
          )
        : translateTimeline(
            timelineComponents,
            translateValue + wrapperWidth - eventsMinDistance
          );
    }

    function showNewContent(timelineComponents, timelineTotWidth, string) {
      var visibleContent = timelineComponents["eventsContent"].find(
          ".selected"
        ),
        newContent =
          string === "next" ? visibleContent.next() : visibleContent.prev();

      if (newContent.length > 0) {
        var selectedDate = timelineComponents["eventsWrapper"].find(".selected"),
          newEvent =
            string === "next"
              ? selectedDate.parent("li").next("li").children("a")
              : selectedDate.parent("li").prev("li").children("a");

        updateFilling(
          newEvent,
          timelineComponents["fillingLine"],
          timelineTotWidth
        );
        updateVisibleContent(newEvent, timelineComponents["eventsContent"]);
        newEvent.addClass("selected");
        selectedDate.removeClass("selected");
        updateOlderEvents(newEvent);
        updateTimelinePosition(
          string,
          newEvent,
          timelineComponents,
          timelineTotWidth
        );
      }
    }

    function updateTimelinePosition(
      string,
      event,
      timelineComponents,
      timelineTotWidth
    ) {
      var eventStyle = window.getComputedStyle(event.get(0), null),
        eventLeft = Number(eventStyle.getPropertyValue("left").replace("px", "")),
        timelineWidth = Number(
          timelineComponents["timelineWrapper"].css("width").replace("px", "")
        ),
        totalWidth = Number(
          timelineComponents["eventsWrapper"].css("width").replace("px", "")
        );
      var timelineTranslate = getTranslateValue(
        timelineComponents["eventsWrapper"]
      );

      if (
        (string === "next" && eventLeft > timelineWidth - timelineTranslate) ||
        (string === "prev" && eventLeft < -timelineTranslate)
      ) {
        translateTimeline(
          timelineComponents,
          -eventLeft + timelineWidth / 2,
          timelineWidth - totalWidth
        );
      }
    }

    function translateTimeline(timelineComponents, value, totWidth) {
      var eventsWrapper = timelineComponents["eventsWrapper"].get(0);
      value = value > 0 ? 0 : value;
      value =
        !(typeof totWidth === "undefined") && value < totWidth
          ? totWidth
          : value;
      setTransformValue(eventsWrapper, "translateX", value + "px");

      value === 0
        ? timelineComponents["timelineNavigation"]
            .find(".prev")
            .addClass("inactive")
        : timelineComponents["timelineNavigation"]
            .find(".prev")
            .removeClass("inactive");
      value === totWidth
        ? timelineComponents["timelineNavigation"]
            .find(".next")
            .addClass("inactive")
        : timelineComponents["timelineNavigation"]
            .find(".next")
            .removeClass("inactive");
    }

    function updateFilling(selectedEvent, filling, totWidth) {
      var eventStyle = window.getComputedStyle(selectedEvent.get(0), null),
        eventLeft = eventStyle.getPropertyValue("left"),
        eventWidth = eventStyle.getPropertyValue("width");
      eventLeft =
        Number(eventLeft.replace("px", "")) +
        Number(eventWidth.replace("px", "")) / 2;
      var scaleValue = eventLeft / totWidth;
      setTransformValue(filling.get(0), "scaleX", scaleValue);
    }

    function setDatePosition(timelineComponents, min) {
      for (let i = 0; i < timelineComponents["timelineDates"].length; i++) {
        var distance = daydiff(
            timelineComponents["timelineDates"][0],
            timelineComponents["timelineDates"][i]
          ),
          distanceNorm =
            Math.round(distance / timelineComponents["eventsMinLapse"]) + 2;
        timelineComponents["timelineEvents"]
          .eq(i)
          .css("left", distanceNorm * min + "px");
      }
    }

    function setTimelineWidth(timelineComponents, width) {
      var timeSpan = daydiff(
          timelineComponents["timelineDates"][0],
          timelineComponents["timelineDates"][
            timelineComponents["timelineDates"].length - 1
          ]
        ),
        timeSpanNorm = Math.round(timeSpan / timelineComponents["eventsMinLapse"]) + 4,
        totalWidth = timeSpanNorm * width;
      timelineComponents["eventsWrapper"].css("width", totalWidth + "px");
      updateFilling(
        timelineComponents["timelineEvents"].eq(0),
        timelineComponents["fillingLine"],
        totalWidth
      );

      return totalWidth;
    }

    function updateVisibleContent(event, eventsContent) {
      var eventDate = event.data("date"),
        visibleContent = eventsContent.find(".selected"),
        selectedContent = eventsContent.find('[data-date="' + eventDate + '"]'),
        selectedContentHeight = selectedContent.height();

      if (selectedContent.index() > visibleContent.index()) {
        selectedContent.attr("class", "selected enter-right");
        visibleContent
          .attr("class", "leave-left")
          .one(
            "webkitAnimationEnd oanimationend msAnimationEnd animationend",
            function () {
              visibleContent.removeClass("leave-left leave-right");
              selectedContent.removeClass("enter-left enter-right");
            }
          );
      } else {
        selectedContent.attr("class", "selected enter-left");
        visibleContent
          .attr("class", "leave-right")
          .one(
            "webkitAnimationEnd oanimationend msAnimationEnd animationend",
            function () {
              visibleContent.removeClass("leave-left leave-right");
              selectedContent.removeClass("enter-left enter-right");
            }
          );
      }
      eventsContent.css("height", selectedContentHeight + "px");
    }

    function updateOlderEvents(event) {
      event
        .parent("li")
        .prevAll("li")
        .children("a")
        .addClass("older-event")
        .end()
        .end()
        .nextAll("li")
        .children("a")
        .removeClass("older-event");
    }

    function getTranslateValue(timeline) {
      var timelineStyle = window.getComputedStyle(timeline.get(0), null),
        timelineTranslate =
          timelineStyle.getPropertyValue("-webkit-transform") ||
          timelineStyle.getPropertyValue("-moz-transform") ||
          timelineStyle.getPropertyValue("-ms-transform") ||
          timelineStyle.getPropertyValue("-o-transform") ||
          timelineStyle.getPropertyValue("transform");

      if (timelineTranslate.indexOf("(") >= 0) {
        timelineTranslate = timelineTranslate.split("(")[1];
        timelineTranslate = timelineTranslate.split(")")[0];
        timelineTranslate = timelineTranslate.split(",");
        var translateValue = timelineTranslate[4];
      } else {
        translateValue = 0;
      }

      return Number(translateValue);
    }

    function setTransformValue(element, property, value) {
      element.style["-webkit-transform"] = property + "(" + value + ")";
      element.style["-moz-transform"] = property + "(" + value + ")";
      element.style["-ms-transform"] = property + "(" + value + ")";
      element.style["-o-transform"] = property + "(" + value + ")";
      element.style["transform"] = property + "(" + value + ")";
    }

    function parseDate(events) {
      var dateArrays = [];
      events.each(function () {
        var dateComp = $(this).data("date").split("/"),
          newDate = new Date(dateComp[2], dateComp[1] - 1, dateComp[0]);
        dateArrays.push(newDate);
      });
      return dateArrays;
    }

    function daydiff(first, second) {
      return Math.round(second - first);
    }

    function minLapse(dates) {
      var dateDistances = [];
      for (let i = 1; i < dates.length; i++) {
        var distance = daydiff(dates[i - 1], dates[i]);
        dateDistances.push(distance);
      }
      return Math.min.apply(null, dateDistances);
    }

    function elementInViewport(el) {
      var top = el.offsetTop;
      var left = el.offsetLeft;
      var width = el.offsetWidth;
      var height = el.offsetHeight;

      while (el.offsetParent) {
        el = el.offsetParent;
        top += el.offsetTop;
        left += el.offsetLeft;
      }

      return (
        top < window.pageYOffset + window.innerHeight &&
        left < window.pageXOffset + window.innerWidth &&
        top + height > window.pageYOffset &&
        left + width > window.pageXOffset
      );
    }

    function checkMQ() {
      return window
        .getComputedStyle(
          document.querySelector(".cd-horizontal-timeline"),
          "::before"
        )
        .getPropertyValue("content")
        .replace(/'/g, "")
        .replace(/"/g, "");
    }
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>

      <section className="cd-horizontal-timeline">
        <div className="timeline">
          <div className="events-wrapper">
            <div className="events">
              <ol>
                <li>
                  <a href="#0" data-date="16/01/2014" className="selected">
                    16 Jan
                  </a>
                </li>
                <li>
                  <a href="#0" data-date="28/02/2014">
                    28 Feb
                  </a>
                </li>
                <li>
                  <a href="#0" data-date="20/03/2014">
                    20 Mar
                  </a>
                </li>
                <li>
                  <a href="#0" data-date="20/05/2014">
                    20 May
