                </li>
                <li>
                  <a href="#0" data-date="10/12/2014">
                    10 Dec
                  </a>
                </li>
                <li>
                  <a href="#0" data-date="19/01/2015">
                    19 Jan
                  </a>
                </li>
                <li>
                  <a href="#0" data-date="03/03/2015">
                    3 Mar
                  </a>
                </li>
              </ol>
              <span className="filling-line" aria-hidden="true"></span>
            </div>
          </div>

          <ul className="cd-timeline-navigation">
            <li>
              <a href="#0" className="prev inactive">
                Prev
              </a>
            </li>
            <li>
              <a href="#0" className="next">
                Next
              </a>
            </li>
          </ul>
        </div>

        <div className="events-content">
          <ol>
            <li className="selected" data-date="16/01/2014">
              <h2>Horizontal Timeline</h2>
              <em>January 16th, 2014</em>
              <p>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Illum
                praesentium officia, fugit recusandae ipsa, quia velit nulla
                adipisci?
              </p>
            </li>
            <li data-date="28/02/2014">
              <h2>Event title here</h2>
              <em>February 28th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="20/03/2014">
              <h2>Event title here</h2>
              <em>March 20th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="20/05/2014">
              <h2>Event title here</h2>
              <em>May 20th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="09/07/2014">
              <h2>Event title here</h2>
              <em>July 9th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="30/08/2014">
              <h2>Event title here</h2>
              <em>August 30th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="15/09/2014">
              <h2>Event title here</h2>
              <em>September 15th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="01/11/2014">
              <h2>Event title here</h2>
              <em>November 1st, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="10/12/2014">
              <h2>Event title here</h2>
              <em>December 10th, 2014</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="19/01/2015">
              <h2>Event title here</h2>
              <em>January 19th, 2015</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
            <li data-date="03/03/2015">
              <h2>Event title here</h2>
              <em>March 3rd, 2015</em>
              <p>Lorem ipsum dolor sit amet...</p>
            </li>
          </ol>
        </div>
      </section>
    </div>
  );
}

export default App;
